Listing.create(:user_id=>"864", :newused=>"Used", :stocknumber=>"617631", :vin=>"JTDKN3DU5D1617631", :year=>"2013", :make=>"Toyota", :model=>"Prius", :bodytype=>"Hatchback", :trim=>"One", :color=>"Winter Gray Metallic", :interiorcolor=>"Dark Gray", :cylinder=>"4", :transmission=>"Variable", :miles=>"79585", :price=>"12850", :description=>"We are proud to present our Clean Carfax 2013 Toyota Prius One pictured in sparkling Winter Gray Metallic. Sporting a 1.8 Liter 4 Cylinder with a 60kw electric motor combo tied to a seamless CVT, this car produces 98hp and achieves a great 51mpg in the city. Stellar fuel economy, impressive technology, and a comfortable ride make this an outstanding green choice to help you own your spend. LED running lights and 15 inch aluminum wheels with aerodynamic wheel covers highlight the stylish exterior of Our Prius One. You'll appreciate key-less entry, heated outdoor mirrors and automatic climate control for perfect cabin temperature. Enjoy the convenience of Bluetooth phone and audio connectivity and an audio system with a 6.1-inch display and USB/iPod interface. With latch anchors for child seats and lots of cargo space, you'll have no problem hauling around the family and all of their stuff. Of course, electronic stability control, brake assist, and numerous airbags will keep you and your precious cargo protected. Our Prius excels as a city car, a family car or a let's go buy groceries in bulk kind of car. See what it can do for you! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"Keyless Start,Front Wheel Drive,Power Steering,4-Wheel Disc Brakes,Aluminum Wheels,Wheel Covers,Tires - Front All-Season,Tires - Rear All-Season,Temporary Spare Tire,Rear Spoiler,Automatic Headlights,Power Mirror(s),Intermittent Wipers,Variable Speed Intermittent Wipers,AM/FM Stereo,CD Player,MP3 Player,Auxiliary Audio Input,Cloth Seats,Bucket Seats,Pass-Through Rear Seat,Rear Bench Seat,Adjustable 