Listing.create(:user_id=>"864", :newused=>"Used", :stocknumber=>"183953", :vin=>"1GT120CG1DF183953", :year=>"2013", :make=>"GMC", :model=>"Sierra 2500HD", :bodytype=>"Crew Cab Pickup", :trim=>"SLE", :color=>"Not Specified", :interiorcolor=>"Color Unknown", :cylinder=>"8", :transmission=>"Automatic", :miles=>"100159", :price=>"27850", :description=>"Our Clean CarFax 2013 GMC Sierra 2500 SLE Crew Cab 4WD, in Red with a Gray interior, offers tremendous capability and control! The 6.0 Liter V8 generates 360hp and 380lb-ft of torque with its heavy duty 6 Speed Automatic transmission. With the included trailering equipment package, you'll find that this Four Wheel Drive provides massive towing/hauling capability and is certainly up to any task! Notice the bold exterior that looks great with a LED cargo box lighting, tow hooks, trailer towing package, a remote locking tailgate and HID projector beam headlamps with LED signature lighting! Our SLE is stronger than ever with two-thirds of the cab structure made of high strength steels.The interior is a fortress of comfort and convenience with everything perfectly in place to help you take command of each day with ease. You'll appreciate power windows/locks, keyless entry, a driver information center, and durable seating. Enjoy your music along the way with our AM/FM/CD/MP3 stereo that features a color touchscreen display, available satellite radio, USB port/auxiliary jack, steering wheel audio controls, Bluetooth, and even OnStar with 4G LTE with available WiFi! Everything you want in a solid truck, our Sierra 2500 lets you feel confident and in control thanks to StabiliTrak with traction control and trailer sway control as well as advanced airbags, daytime running lamps, tire pressure monitoring, and even Teen Driver. Take on your toughest tasks with the precision and powerful performance brought to you by GMC Sierra 2500! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :optio