Listing.create(:user_id=>"864", :newused=>"Used", :stocknumber=>"347982", :vin=>"3GCUKSEC3EG347982", :year=>"2014", :make=>"Chevrolet", :model=>"Silverado 1500", :bodytype=>"Crew Cab Pickup", :trim=>"LTZ", :color=>"Silver Ice Metallic", :interiorcolor=>"Jet Black", :cylinder=>"8", :transmission=>"Automatic", :miles=>"65640", :price=>"34850", :description=>"Conquer the road in our legendary Clean Carfax 2014 Chevrolet Silverado 1500 Crew Cab LTZ 4x4 decked out in handsome Silver Ice Metallic. Under the hood of this redesigned flagship of Chevrolet is a 5.3 Liter V8 offers 355hp. It offers exceptional fuel economy of 23mpg and a tough 6 Speed Automatic transmission. Muddy rural roads, mountain terrain, towing your boat, or hauling lumber are no challenge for our Four Wheel Drive Silverado. The beefy front suspension eases you down the road in comfort while the rear setup is tough enough to keep up with your demanding life. The commanding appearance of this LTZ with 20-inch alloy wheels improves any landscape. Meanwhile, the upscale interior features an exclusive dash design with wood and metallic accents, leather heated front bucket seats and driver-seat memory settings that make you feel like the king of the road. MyLink, a massive central display, Bluetooth and a Bose audio system with a six-disc CD changer, a USB/iPod interface, and rear audio controls keeps you connected and entertained along the way. Well-known GM safety features are in place like Stabilitrak, 4-wheel ABS, daytime running lamps, and plenty of airbags. This no-nonsense truck will make sure it fulfills your needs for work and play. Get the job done right with the security, performance, and comfort that only come from the Chevrolet Silverado. Don't delay! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"ENGINE  5.3L FLEXFUEL ECOTEC3 V8 WITH ACTIVE FUEL MANAGEMENT  DIRECT INJECTION AND VARIABLE VALVE TIMING  includes aluminum block constructi