 Mirror(s),Integrated Turn Signal Mirrors,Mirror Memory,Power Windows,Sliding Rear Window,Privacy Glass,Intermittent Wipers,Variable Speed Intermittent Wipers,Third Passenger Door,Fourth Passenger Door,AM/FM Stereo,CD Player,Satellite Radio,MP3 Player,Steering Wheel Audio Controls,Bluetooth Connection,Telematics,Auxiliary Audio Input,Navigation from Telematics,Power Driver Seat,Power Passenger Seat,Leather Seats,Split Bench Seat,Heated Front Seat(s),Seat Memory,Pass-Through Rear Seat,Rear Bench Seat,Floor Mats,Leather Steering Wheel,Adjustable Steering Wheel,Trip Computer,Power Door Locks,Security System,Adjustable Pedals,Keyless Entry,Cruise Control,Engine Immobilizer,Climate Control,Multi-Zone A/C,Rear Defrost,Power Outlet,Auto-Dimming Rearview Mirror,Driver Vanity Mirror,Passenger Vanity Mirror,Driver Illuminated Vanity Mirror,Passenger Illuminated Visor Mirror,ABS,Traction Control,Stability Control,Driver Air Bag,Passenger Air Bag,Front Side Air Bag,Front Head Air Bag,Rear Head Air Bag,Tire Pressure Monitor", :enginedescription=>"Turbocharged Gas V6 3.5L/213", :fuel=>"Gasoline Fuel", :title=>"2013 Ford F-150", :external_image=>"https://content.homenetiol.com/2001923/2134085/0x0/977d5546d945478ebbfa9cfe76271c4b.jpg", :external_imagefront=>"https://content.homenetiol.com/2001923/2134085/0x0/56ba83220afa4c0f8412a1c30e996903.jpg", :external_imageback=>"https://content.homenetiol.com/2001923/2134085/0x0/ab6899a1a4774eb5aef4d93a25538539.jpg", :external_imageleft=>"https://content.homenetiol.com/2001923/2134085/0x0/17567b5adf854d36ad682aa7e91d3f14.jpg", :external_imageright=>"https://content.homenetiol.com/2001923/2134085/0x0/ced7ff5025ea432c95dfe6d15c920bc7.jpg", :external_frontinterior=>"https://content.homenetiol.com/2001923/2134085/0x0/32745aa62a9a4a0ea2b8a657ec7fc22f.jpg", :external_rearinterior=>"https://content.homenetiol.com/2001923/2134085/0x0/5e6a07f16cc240ef8e267b73d80ac1ec.jpg", :external_url=>true, :approved=>true)
Listing.create(:user_id=>"864", :newused=>"Used", :stocknumber=>"347810", :vin=>"5TFDW5F19EX347810", :year=>"2014", :make=>"Toyota", :model=>"Tundra 4WD Truck", :bodytype=>"Crew Cab Pickup", :trim=>"SR5", :color=>"Radiant Red", :interiorcolor=>"Graphite", :cylinder=>"8", :transmission=>"Automatic", :miles=>"30989", :price=>"34850", :description=>"Every road leads to adventure in our One Owner Clean Carfax 2014 Toyota Tundra SR5 Crew Max 4WD presented here in Radiant Red. The 5.7 Liter V8 powerhouse under the bold new hood provides all the muscle you need, churning out 381hp on demand and tethered to a smooth 6 Speed automatic. This team provides you with 18mpg hwy and acceleration that will get your blood pumping. Whether you're tackling trails or gliding down the freeway, this truck exudes capability, style and strength with off-road capability and Four Wheel Drive prowess. Redesigned for 2014, the masculine charm of our SR5 is highlighted by an integrated hood and chrome grille, 18' alloy wheels, and off-road tires. You'll also appreciate skid plates, front tow hooks and Bilstein shocks. Premium materials on stylish gauges, practical buttons and knobs are refreshingly easy to use and add to the ergonomic design and craftsmanship of the cabin. Bluetooth connectivity, a convenient touchscreen display and satellite radio keep you connected and entertained so you can get your job done in comfort and style. Just try to suppress the smile on your face as this truck works smoothly through its gears propelling you down the road while turning heads. Built in the U.S.A, this truck leads the pack in safety thanks to intelligently designed ABS, stability/ traction control, trailer sway control, and numerous airbags. You deserve an attractive truck that works hard so you can play harder. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"Four Wheel Drive,Tow Hitch,Power Steering,ABS,4-Wheel Disc Brakes,Brake Assist,Brake