Listing.create(:user_id=>"864", :newused=>"Used", :stocknumber=>"115723", :vin=>"1GYS4HKJ6HR115723", :year=>"2017", :make=>"Cadillac", :model=>"Escalade ESV", :bodytype=>"Sport Utility", :trim=>"Luxury", :color=>"Radiant Silver Metallic", :interiorcolor=>"Jet Black", :cylinder=>"8", :transmission=>"Automatic", :miles=>"35054", :price=>"62950", :description=>"Reward yourself with power and prestige in our One Owner Clean Carfax 2017 Cadillac Escalade ESV Luxury 4WD that's outstanding in Radiant Silver Metallic! Beneath the hood is a potent 6.2 Liter V8 that generates 420hp and 460lb-ft of torque with its smooth-shifting 8 Speed Automatic. Enjoy near 21mpg and a capable, poised ride thanks in part to selectable Magnetic Ride Control suspension. Our Escalade ESV Luxury radiates premium good looks inside and out. Take notice of the gorgeous alloy wheels, hands-free lift-gate, and overall strong presence. The masterfully crafted cabin can accommodate up to 8 people and indulges you with adaptive remote start, a heated steering wheel, supple leather, heated second row seats, heated/cooled front seats and tri-zone automatic climate control. Our CUE and media touchscreen with embedded navigation will guide you to your destination while you stay safely connected via Bluetooth and WiFi capability, or while listening to the premium Bose sound system with HD and available satellite radio. The most acclaimed SUV, our Escalade ESV is most definitely going to exceed your expectations! Advanced safety features such as a surround-view camera, a head up display, automatic park assist, blind spot monitoring, lane departure warning, forward collision warning, anti-lock disc brakes, stability/traction control, and advanced airbags add to the feeling of confidence you'll feel each time you get behind the wheel. The pinnacle of luxury and refinement paired with incredible capability, our Escalade ESV is the wise choice. Print this page and call us Now... We Know You Will Enjoy Your Test D