Listing.create(:user_id=>"864", :newused=>"Used", :stocknumber=>"349085", :vin=>"3GTU2UEC9FG349085", :year=>"2015", :make=>"GMC", :model=>"Sierra 1500", :bodytype=>"Crew Cab Pickup", :trim=>"SLE", :color=>"Summit White", :interiorcolor=>"Jet Black", :cylinder=>"8", :transmission=>"Automatic", :miles=>"55387", :price=>"34200", :description=>"Built with your needs in mind, our Clean Carfax 2015 GMC Sierra 1500 SLE Crew Cab is presented in beautiful Summit White. This sure-footed 4WD will exceed your daily needs with a proven 355hp EcoTec3 5.3 Liter V8 engine that offers the best V8 fuel economy in any full size pickup at 22mpg highway! It is mated with a tough working 6-Speed automatic transmission electronically controlled with overdrive and Tow/Haul mode to provide great hauling and towing capability and paired with coil over shock front suspension, offers a controlled ride that is the ultimate in comfort and handling. Our hard working Sierra 1500 SLE has a massive grille, distinct CornerStep chrome rear bumpers, and an EZ Lift and Lower locking tailgate. Review our pictures and you'll agree that this is a solid professional grade full-size machine! Cloth seating, a leather-wrapped steering wheel with audio/cruise controls, rear vision camera, an 8 inch diagonal Color-Touch Radio with IntelliLink, and a color Driver Information Center display are just a few of the ample amenities. Sierra's cabin is engineered to provide you and your passengers with a quiet, comfortable experience! The well-known GM safety features are in place, including Stabilitrak with Traction Control, Hill Start Assist, and plenty of airbags. This no-nonsense truck will make sure it fulfills your needs for work and play. Get the job done right, with the security, performance, and comfort that only come from the GMC Sierra 1500. Don't delay... Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"SLE VALUE PACKAGE  includes (AG1) driver 10-way