Listing.create(:user_id=>"864", :newused=>"Used", :stocknumber=>"437636", :vin=>"3GCUKSEC7EG437636", :year=>"2014", :make=>"Chevrolet", :model=>"Silverado 1500", :bodytype=>"Crew Cab Pickup", :trim=>"LTZ", :color=>"Blue Granite Metallic", :interiorcolor=>"Jet Black", :cylinder=>"8", :transmission=>"Automatic", :miles=>"64830", :price=>"33850", :description=>"Conquer the road in our legendary One Owner Clean Carfax 2014 Chevrolet Silverado 1500 Crew Cab LTZ 4x4 decked out in handsome Blue Granite Metallic. Powered by a 5.3 Liter V8 that offers 355hp while connected to a 6 Speed Automatic transmission for astonishing towing and passing authority. Muddy rural roads, mountain terrain, towing your boat, or hauling lumber are no challenge for our Four Wheel Drive Silverado that helps you see near 23mpg. The front suspension eases you down the road in comfort while the rear set up is tough enough to keep up with your demanding life. The commanding appearance of this Silverado Crew Cab LTZ with its alloy wheels improves any landscape. The upscale LTZ interior features an exclusive dash design with wood and metallic accents, leather, heated front bucket seats and driver-seat memory settings. MyLink, a central display, Bluetooth, and a Bose audio system with a six-disc CD changer, a USB/iPod interface and rear audio controls keeps you connected and entertained along the way. Well-known GM safety features are in a place like Stabilitrak, 4-wheel ABS, daytime running lamps, and plenty of airbags. This no-nonsense truck will make sure it fulfills your needs for work and play. Get the job done right with the security, performance, and comfort that only come from the Silverado. Don't delay! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"ENGINE  5.3L FLEXFUEL ECOTEC3 V8 WITH ACTIVE FUEL MANAGEMENT  DIRECT INJECTION AND VARIABLE VALVE TIMING  includes aluminum block construction with Flex Fuel capability  capable of runnin