Listing.create(:user_id=>"864", :newused=>"Used", :stocknumber=>"E65130", :vin=>"1FTEW1EG5FKE65130", :year=>"2015", :make=>"Ford", :model=>"F-150", :bodytype=>"Crew Cab Pickup", :trim=>"XLT", :color=>"Ingot Silver Metallic", :interiorcolor=>"Black", :cylinder=>"6", :transmission=>"Automatic", :miles=>"82576", :price=>"29950", :description=>"Even tougher and stronger than before, our Clean CarFax 2015 Ford F-150 XLT SuperCrew Four Wheel Drive with FX4 Package in Ingot Silver has been re-engineered with a high-strength, military grade, aluminum-alloy body and high-strength steel frame to increase capability and efficiency! The 3.5 Liter Flex Fuel V6 generates 283hp and 255 pound-feet of torque while tethered to a durable 6 Speed Automatic with Sport and Tow/Haul modes. No matter how grueling your day, you'll enjoy scoring near 25mpg on the highway and have the muscle to haul or pull heavy loads! Dominate the road in this F-150 that is both modern and aerodynamic in design with chrome trim, fog lights and prominent alloy wheels. You and your crew will be comfortable inside the well-thought out cabin with clever storage, power accessories, and cloth upholstery. Stay safely connected thanks to Ford's Sync voice control smartphone integration system, while taking advantage of Bluetooth phone/audio connectivity and USB/auxiliary audio input jacks for the sound system. Buckle-up your tool belt and enjoy this solid, composed ride! Safety features on our F-150 include anti-lock disc brakes, stability and traction control, trailer sway control, front-seat side impact airbags and full-length side-curtain airbags. Our F-150 is leading the way! Get behind the wheel of this workhorse today! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"ENGINE: 3.5L V6 ECOBOOST  -inc: 3.31 Axle Ratio  GVWR: 7 000 lbs Payload Package,Four Wheel Drive,Power Steering,ABS,4-Wheel Disc Brakes,Brake Assist,Aluminum Wheels,Tires - Front All-Terrain,Tires - Rear All-Terrain,Conventional Spare Tire,Tow Hooks,Power Mirror(s),Intermittent Wipers,Variable Speed Intermittent Wipers,Privacy Glass,Power Door Locks,Daytime Running Lights,Automatic Headlights,Fog Lamps,AM/FM Stereo,CD Player,MP3 Player,Auxiliary Audio Input,Steering Wheel Audio Controls,Bluetooth Connection,Smart Device Integration,Cloth Seats,Split Bench Seat,Driver Adjustable Lumbar,Passenger Adjustable Lumbar,Pass-Through Rear Seat,Rear Bench Seat,Adjustable Steering Wheel,Power Windows,Keyless Entry,Cruise Control,A/C,Driver Vanity Mirror,Passenger Vanity Mirror,Floor Mats,Engine Immobilizer,Security System,Traction Control,Stability Control,Front Side Air Bag,Tire Pressure Monitor,Driver Air Bag,Passenger Air Bag,Passenger Air Bag Sensor,Front Head Air Bag,Rear Head Air Bag,Child Safety Locks", :enginedescription=>"Twin Turbo Regular Unleaded V-6 3.5 L/213", :fuel=>"Gasoline Fuel", :title=>"2015 Ford F-150", :external_image=>"https://content.homenetiol.com/2001923/2134085/0x0/eb92b5d2098845498f26e65d6a7f8b7e.jpg", :external_imagefront=>"https://content.homenetiol.com/2001923/2134085/0x0/f47d7b6a070642d2ba11bfc4319541e6.jpg", :external_imageback=>"https://content.homenetiol.com/2001923/2134085/0x0/a6324515ed2446439ca92e748c7dfe27.jpg", :external_imageleft=>"https://content.homenetiol.com/2001923/2134085/0x0/5b4a922c82fd4dc7980e30c315db358e.jpg", :external_imageright=>"https://content.homenetiol.com/2001923/2134085/0x0/4a8cefa11f86489492a4f8cd9eaa9e1b.jpg", :external_frontinterior=>"https://content.homenetiol.com/2001923/2134085/0x0/2879036d6cf54ae382f0088313f68108.jpg", :external_url=>true, :approved=>true)
