Listing.create(:user_id=>"864", :newused=>"Used", :stocknumber=>"234283", :vin=>"1GCPKSE76CF234283", :year=>"2012", :make=>"Chevrolet", :model=>"Silverado 1500", :bodytype=>"Crew Cab Pickup", :trim=>"LT", :color=>"White Diamond Tricoat", :interiorcolor=>"Light Titanium/Dark Titanium", :cylinder=>"8", :transmission=>"Automatic", :miles=>"99623", :price=>"21900", :description=>"Our 2012 Chevrolet Silverado 1500 LT Crew Cab 4x4 is shown proudly in a rugged White Diamond Tricoat finish. Powered by our proven 5.3 Liter V8 offers 315hp while connected to a tough built 4 Speed Automatic transmission for easy passing and towing. This Four Wheel Drive scores near 21mpg on the highway and owners love the coil over shock front independent suspension as it takes the beast out of the truck and provides you with a nimble work machine. This Chevrolet will certainly exceed your towing or hauling requirements and certainly remind you that solid like a rock really does exist. Our pictures show this LT Crew Cab supplies comfortable cloth seating with upscale elements generally found in expensive luxury brands. Power goodies await you along with an impressive sound system and climate control that adds to the prestige. The well-known GM safety features are in place to protect you, your family and your cargo. StabiliTrak, 4-wheel ABS, daytime running lamps, and plenty of airbags have one combined mission, your safety. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"ENGINE  VORTEC 5.3L VARIABLE VALVE TIMING V8 SFI FLEXFUEL WITH ACTIVE FUEL MANAGEMENT  capable of running on unleaded or up to 85% ethanol (with gas - 315 hp [234.8 kW] @ 5200 rpm  335 lb-ft of torque [452.2 N-m] @ 4000 rpm)  aluminum block,Four Wheel Drive,Tow Hooks,Power Steering,ABS,Front Disc/Rear Drum Brakes,Chrome Wheels,Tires - Front All-Season,Tires - Rear All-Season,Conventional Spare Tire,Automatic Headlights,Heated Mirrors,Power Mirror(s),Privacy Glass,Inte