Listing.create(:user_id=>"864", :newused=>"Used", :stocknumber=>"219398", :vin=>"1FADP3F24EL219398", :year=>"2014", :make=>"Ford", :model=>"Focus", :bodytype=>"4dr Car", :trim=>"SE", :color=>"Ingot Silver Metallic", :interiorcolor=>"Medium Light Stone", :cylinder=>"4", :transmission=>"Automatic", :miles=>"51999", :price=>"9850", :description=>"Meet our One Owner Clean Carfax 2014 Ford Focus SE sedan viewed in Ingot Silver Metallic. Take in the lean lines and smart styling then prepare to be impressed with the crisp punch of this 2.0 Liter. It offers 160hp on demand while sipping on Flex Fuel or unleaded and while connected to a quick shifting 5 Speed Manual, you will enjoy near 36mpg. With less trips to the gas pump you will have more time and money for the good things in life! Driving the Focus SE is pure enjoyment when you have amenities such as Ford Sync on-board. Voice-activated phone and stereo controls ensure your hands are on the wheel and eyes on the road. Combine the superb 6 speaker stereo system, comfortable seats, power windows and locks, tilt and telescoping steering wheel, a handy front center storage console and you are riding in style. Ford always strives to make your ride one of the safest on the road and once again they stepped up to the plate providing six standard airbags, electronic stability control, anti-lock brakes and tire pressure monitoring that all ensure the safest ride possible. It's no surprise the 2014 Ford Focus earned 5 stars on the national safety ratings. MyKey technology allows parents to designate a key that will operate special features such as speed and audio volume to ensure safe teen driving. You can't go wrong with a Ford Focus! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"Front Wheel Drive,Power Steering,ABS,Front Disc/Rear Drum Brakes,Brake Assist,Brake Actuated Limited Slip Differential,Aluminum Wheels,Tires - Front Performance,Tires - Rear Performance,Temporary Spare Tire,Power Mirror(s),Rear Defrost,Intermittent Wipers,Variable Speed Intermittent Wipers,Automatic Headlights,AM/FM Stereo,CD Player,MP3 Player,Auxiliary Audio Input,Rear Bench Seat,Adjustable Steering Wheel,Trip Computer,Power Windows,Keyless Entry,Power Door Locks,Cruise Control,A/C,Cloth Seats,Bucket Seats,Driver Vanity Mirror,Passenger Vanity Mirror,Driver Illuminated Vanity Mirror,Passenger Illuminated Visor Mirror,Floor Mats,Steering Wheel Audio Controls,Bluetooth Connection,Engine Immobilizer,Traction Control,Stability Control,Front Side Air Bag,Tire Pressure Monitor,Driver Air Bag,Passenger Air Bag,Front Head Air Bag,Rear Head Air Bag,Passenger Air Bag Sensor,Knee Air Bag,Child Safety Locks", :enginedescription=>"Regular Unleaded I-4 2.0 L/122", :fuel=>"Gasoline Fuel", :title=>"2014 Ford Focus", :external_image=>"https://content.homenetiol.com/2001923/2134085/0x0/ad29262e490b460596f60e2329f940e3.jpg", :external_imagefront=>"https://content.homenetiol.com/2001923/2134085/0x0/ea9584babf544e6ca3a3760a38f3a8ea.jpg", :external_imageback=>"https://content.homenetiol.com/2001923/2134085/0x0/e9a2df2edaa24ba2960c6de0dabc13ac.jpg", :external_imageleft=>"https://content.homenetiol.com/2001923/2134085/0x0/121e6c0d407e49c5a626d71d7b547e40.jpg", :external_imageright=>"https://content.homenetiol.com/2001923/2134085/0x0/db3b5460078c4e31a7b91cca50769b14.jpg", :external_frontinterior=>"https://content.homenetiol.com/2001923/2134085/0x0/1369eb796b124d4a98775583c784e9c2.jpg", :external_rearinterior=>"https://content.homenetiol.com/2001923/2134085/0x0/d026ae76c6ce428596f66df91c99f0b2.jpg", :external_url=>true, :approved=>true)
Listing.create(:user_id=>"864", :newused=>"Used", :stocknumber=>"C49422", :vin=>"1FM5K8GT9DGC49422", :year=>"2013", :make=>"Ford", :model=>"Explorer", :bodytype=>"Sport Utility", :trim=>"Sport", :color=>"Ruby Red Metallic Tinted Clearcoat", :interiorcolor=>"Charcoal Black/Sienna Insert", :cylinder=>"6", :transmission=>"Automatic", :miles=>"85542", :price=>"21950", :description=>"Our athletic One Owner, Clean Carfax 2013 Ford Explorer Sport AWD displayed in beautiful Ruby Red Tinted Clearcoat is waiting for you! This 7 passenger SUV is powered by an incredible TurboCharged 3.5 Liter EcoBoost V6 that offers 350hp on demand while tethered to a smooth shifting 6 Speed SelectShift Automatic transmission for amazing passing power. This All Wheel Drive Sport can help you secure near 22mpg. You'll be ready for all road conditions and this bold design turns heads with its chrome accents, streamlined body colored molding and overall handsome style. Projector beam headlights and LED taillights set the stage while unique 20-inch wheels enhance the view. Look inside and see premium features everywhere like a dual-panel sunroof, full-color navigation, and a backup camera. MyFord Touch with Sony Audio offers the latest news, weather, and tunes with media hub. You'll have plenty of power points to keep everyone in the family plugged in. Rear climate control and dual screen DVD system to keep the passengers happy! Superb lighting and storage options make this Sport just right for your family's needs. This SUV from Ford is unparalleled in safety with airbags, SOS post-crash alert, tire pressure monitoring, reverse sensing system and traction control. MyKey even allows you to set controls such as speed and volume for young drivers. Get behind the wheel to see what The Sport can do for you! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", :options=>"Turbocharged,Four Wheel Drive,Tow Hooks,Power Steering,Tires - Front Performance,Tires - R